import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import {colors} from '../../utilities';
import {SliderContainer} from '../Container';
import {SliderLink} from '../Button';
import Jumping from '../svg/Jumping.jsx';

const Jumpings = ({className}) => {
  return (
    <SliderContainer className={className}> 
      <div className="icon">
        <Jumping size={40}/>        
      </div>
      <h3 className="title slide_title">Jumpings</h3>
      <div className="text">
      <p className="txt">Tama√≥s chico, mediano, grande y jumbo</p>
      </div>      
      <SliderLink>
          <Link to={'/items/jumping'}>Explorar</Link>  
      </SliderLink>
      <div className="img_box">
        <img className="img" src="https://res.cloudinary.com/noryan/image/upload/v1596033760/foto_covers/jumping_jumbo.png" alt=""/>
      </div>
    </SliderContainer>
  );
}

const SlideJumpings = styled(Jumpings)`
  background-image: linear-gradient(to right, ${colors.noryan_blue}, ${colors.blue_1}  ); 

`;

export default SlideJumpings;
